import Head from "next/head";

export default function App() {
  return (
    <>
      <Head>
        <title>Test Fulogy</title>
        {/* <link rel="icon" href="/favicon.ico" /> */}
      </Head>
      <main>
        <h1 className="hidden">Форма</h1>
        <section className="mainContent"></section>
      </main>

      <style jsx>
        {`
          .mainContent {
            background-color: red;
            width: 300px;
            height: 300px;
            background: url("/rectangle.png") top center / contain no-repeat;
          }
        `}
      </style>
      <style jsx global>
        {`
          .hidden {
            visibility: hidden;
          }
        `}
      </style>
    </>
  );
}
